import React from 'react';

import { motion } from 'framer-motion';
import { Quiz, Description, School, CloudUpload } from '@mui/icons-material';
import { Link } from 'react-router-dom';

const features = [
  {
    icon: <Description fontSize="large" color="primary" />,
    title: "Multiple Formats",
    description: "Upload PDF, DOCX, or TXT files to generate quizzes."
  },
  {
    icon: <Quiz fontSize="large" color="primary" />,
    title: "Various Quiz Types",
    description: "Generate multiple choice, true/false, or fill-in-the-blank questions."
  },
  {
    icon: <School fontSize="large" color="primary" />,
    title: "Learn Better",
    description: "Test your knowledge and improve retention with AI-generated quizzes."
  }
];

const Home = () => {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Box sx={{ 
        background: 'linear-gradient(135deg, #121212 0%, #1e1e1e 100%)',
        py: 10,
        textAlign: 'center'
      }}>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography variant="h2" component="h1" gutterBottom sx={{ fontWeight: 700 }}>
            AI-Powered Quiz Generator
          </Typography>
          <Typography variant="h5" component="h2" gutterBottom sx={{ mb: 4 }}>
            Transform any document into an interactive quiz
          </Typography>
          <Button 
            variant="contained" 
            size="large" 
            component={Link} 
            to="/generate"
            startIcon={<CloudUpload />}
            sx={{ px: 6, py: 1.5, fontSize: '1.1rem' }}
          >
            Generate Quiz Now
          </Button>
        </motion.div>
      </Box>

      <Box sx={{ p: 4 }}>
        <Typography variant="h4" align="center" gutterBottom sx={{ mb: 6 }}>
          How It Works
        </Typography>
        
        <Grid container spacing={4} justifyContent="center">
          {features.map((feature, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <motion.div
                whileHover={{ y: -5 }}
                transition={{ duration: 0.3 }}
              >
                <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                  <CardContent sx={{ flexGrow: 1, textAlign: 'center' }}>
                    <Box sx={{ mb: 2 }}>
                      {feature.icon}
                    </Box>
                    <Typography gutterBottom variant="h5" component="h3">
                      {feature.title}
                    </Typography>
                    <Typography>
                      {feature.description}
                    </Typography>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Box>

      <Paper elevation={0} sx={{ p: 4, mt: 6, background: 'linear-gradient(135deg, #1e1e1e 0%, #121212 100%)' }}>
        <Typography variant="h4" align="center" gutterBottom>
          Ready to test your knowledge?
        </Typography>
        <Box sx={{ textAlign: 'center', mt: 3 }}>
          <Button 
            variant="contained" 
            size="large" 
            component={Link} 
            to="/generate"
            sx={{ px: 6, py: 1.5, fontSize: '1.1rem' }}
          >
            Get Started
          </Button>
        </Box>
      </Paper>
    </Box>
  );
};

export default Home;
